import React, { useContext } from 'react';
import { DentistContext } from './DentistContext';

const Card = ({ name, username, email }) => {
  return (
    <div className="card">
      <h2>{name}</h2>
      <p>{username}</p>
      <p>{email}</p>
    </div>
  );
};

const DentistsList = () => {
  const { dentists } = useContext(DentistContext);

  return (
    <div>
      {dentists.map(dentist => (
        <Card
          key={dentist.id}
          name={dentist.name}
          username={dentist.username}
          email={dentist.email}
        />
      ))}
    </div>
  );
};

export default DentistsList;
